import React from "react";
import LibrarySongs from "./LibrarySongs";

const Library = ({ songs }) => {
    return (
        <div className="library">
            <h1>Music Library</h1>
            <LibrarySongs songs={songs} />
        </div>
    )
}

export default Library;
